import React from 'react'
import { Link, withRouter } from 'react-router-dom'

class Login extends React.Component {
  render() {
    return(
      <div className="site-entrance">
        <h3 className="site-entrance__title">
          Вход
        </h3>
        <form className="site-entrance__form">
          {/* <label htmlFor="email">
            Электронная почта
          </label> */}
          <input
              required id="email" name="email" type="email" placeholder="Email" />
          <input
              required id="password" name="password" type="password" placeholder="Пароль" />
          <button type="submit" >
            Войти
          </button>
        </form>
      </div>
    )
  }
}

export default withRouter(Login)
